// src/application/services/TaskApplicationService.ts
class TaskApplicationService {
  taskRepository;
  constructor(taskRepository) {
    this.taskRepository = taskRepository;
  }
  async createTask(dto) {
    const title = TaskTitle.create(dto.title);
    const description = TaskDescription.create(dto.description);
    const priority = dto.priority;
    const dueDate = new Date(dto.dueDate);
    if (!TaskPriority.isValid(priority)) {
      throw new Error("Invalid task priority");
    }
    const task = Task.create(title, description, priority, dueDate);
    await this.taskRepository.save(task);
    return this.taskToDto(task);
  }
  async getTasks(criteria) {
    const tasks = await this.taskRepository.findAll(criteria);
    return tasks.map((task) => this.taskToDto(task));
  }
  async getTaskById(id) {
    const taskId = TaskId.create(id);
    const task = await this.taskRepository.findById(taskId);
    return task ? this.taskToDto(task) : null;
  }
  async updateTask(dto) {
    const taskId = TaskId.create(dto.id);
    const existingTask = await this.taskRepository.findById(taskId);
    if (!existingTask) {
      throw new Error("Task not found");
    }
    const title = TaskTitle.create(dto.title);
    const description = TaskDescription.create(dto.description);
    const status = dto.status;
    const priority = dto.priority;
    const dueDate = new Date(dto.dueDate);
    if (!TaskStatus.isValid(status)) {
      throw new Error("Invalid task status");
    }
    if (!TaskPriority.isValid(priority)) {
      throw new Error("Invalid task priority");
    }
    existingTask.update(title, description, status, priority, dueDate);
    await this.taskRepository.save(existingTask);
    return this.taskToDto(existingTask);
  }
  async deleteTask(id) {
    const taskId = TaskId.create(id);
    return await this.taskRepository.delete(taskId);
  }
  async getTaskStats() {
    return await this.taskRepository.getStats();
  }
  taskToDto(task) {
    return {
      id: task.id.value,
      title: task.title.value,
      description: task.description.value,
      status: task.status,
      priority: task.priority,
      dueDate: task.dueDate.getTime(),
      createdAt: task.createdAt.getTime(),
      updatedAt: task.updatedAt.getTime()
    };
  }
}

// src/infrastructure/repositories/InMemoryTaskRepository.ts
class InMemoryTaskRepository {
  tasks = new Map;
  async save(task) {
    this.tasks.set(task.id.value, task);
  }
  async findById(id) {
    const task = this.tasks.get(id.value);
    return task || null;
  }
  async findAll(criteria) {
    let tasks = Array.from(this.tasks.values());
    if (criteria?.status !== undefined) {
      tasks = tasks.filter((task) => task.status === criteria.status);
    }
    tasks.sort((a2, b4) => b4.createdAt.getTime() - a2.createdAt.getTime());
    const offset = criteria?.offset || 0;
    const limit = criteria?.limit || tasks.length;
    return tasks.slice(offset, offset + limit);
  }
  async delete(id) {
    return this.tasks.delete(id.value);
  }
  async count(status) {
    if (status === undefined) {
      return this.tasks.size;
    }
    return Array.from(this.tasks.values()).filter((task) => task.status === status).length;
  }
  async getStats() {
    const tasks = Array.from(this.tasks.values());
    return {
      totalTasks: tasks.length,
      pendingTasks: tasks.filter((task) => task.status === 0 /* PENDING */).length,
      inProgressTasks: tasks.filter((task) => task.status === 1 /* IN_PROGRESS */).length,
      completedTasks: tasks.filter((task) => task.status === 2 /* COMPLETED */).length,
      cancelledTasks: tasks.filter((task) => task.status === 3 /* CANCELLED */).length
    };
  }
}

